import "./Login.css"

export default function Login() {
    const userRef = userRef()
    const passwordRef = userRef() 
    const handleSubmit = (e) =>{
        e.prenventDefault()
    }
    return (
        <div className="login">
            <span className="loginTitle">Login</span>
            <form className="loginForm" onSubmit={handleSubmit}>
                <label>Username</label>
                <input 
                type="text" 
                className="loginInput" 
                placeholder="Enter  your username" 

                />
                <label>Password</label>
                <input type="password" className="loginInput" placeholder="Enter strong password" />
                <button className="loginButton" type="sumbit">Login</button>
            </form>
            <button className="loginRegisterButton"><Link to="/register" className="link">Register</Link></button>
        </div>
    )
}
